import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import logo from "./image.png";

const SignupPage = () => {
  const [name, setName] = useState("");
  const [phone, setPhone] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState(""); // Pour gérer les erreurs
  const navigate = useNavigate();

  // Fonction pour envoyer les données d'inscription
  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!name || !phone || !password) {
      setError("Please fill all the fields.");
      // Réinitialiser les champs après l'erreur
      setName("");
      setPhone("");
      setPassword("");
      return;
    }

    try {
      // Envoi des données au backend via fetch (il faut que ton backend accepte cette route)
      const response = await fetch("/api/register", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ name, phone, password, role: "donor" }), // Le rôle par défaut est "donor"
      });

      const result = await response.json();

      if (response.ok) {
        // Si l'inscription est réussie, redirige vers la page de connexion
        navigate("/donate");
      } else {
        setError(result.message || "Registration failed. Please try again.");
        // Réinitialiser les champs après l'erreur
        setName("");
        setPhone("");
        setPassword("");
      }
    } catch (err) {
      setError("Something went wrong. Please try again.");
      // Réinitialiser les champs après l'erreur
      setName("");
      setPhone("");
      setPassword("");
    }
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      {/* Header rouge avec bouton retour */}
      <div className="w-full bg-red-500 py-6 flex items-center justify-between px-4 rounded-b-3xl">
        <button
          onClick={() => navigate("/donate")} // Retour à la page de connexion
          className="text-white text-2xl font-bold"
        >
          ←
        </button>

        <img src={logo} alt="Blood Bank Logo" className="w-16 h-16 object-contain" /> {/* Logo agrandi */}

        <div className="w-8"></div>
      </div>

      {/* Carte d'inscription */}
      <div className="bg-white shadow-lg rounded-lg p-6 w-80 mt-[-30px]">
        <h2 className="text-center text-xl font-bold mb-4">SIGN UP</h2>

        {error && <div className="text-red-500 text-center mb-4">{error}</div>} {/* Affichage de l'erreur */}

        {/* Champs Name */}
        <div className="mb-4">
          <label className="block text-gray-700">Name</label>
          <input
            type="text"
            placeholder="Type your name"
            value={name} // Lier à l'état
            onChange={(e) => setName(e.target.value)} // Mettre à jour l'état
            className="w-full px-3 py-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-red-400"
          />
        </div>

        {/* Champs Phone */}
        <div className="mb-4">
          <label className="block text-gray-700">Phone</label>
          <input
            type="text"
            placeholder="Type your phone"
            value={phone} // Lier à l'état
            onChange={(e) => setPhone(e.target.value)} // Mettre à jour l'état
            className="w-full px-3 py-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-red-400"
          />
        </div>

        {/* Champs Password */}
        <div className="mb-6">
          <label className="block text-gray-700">Password</label>
          <input
            type="password"
            placeholder="Type your password"
            value={password} // Lier à l'état
            onChange={(e) => setPassword(e.target.value)} // Mettre à jour l'état
            className="w-full px-3 py-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-red-400"
          />
        </div>

        {/* Bouton d'inscription */}
        <button
          onClick={handleSubmit}
          className="w-full bg-red-500 text-white py-2 rounded-md font-bold hover:bg-red-600"
        >
          SIGN UP
        </button>

        {/* Lien pour revenir à la connexion */}
        <p className="text-center text-gray-600 mt-4">
          Already have an account?{" "}
          <span
            onClick={() => navigate("/donate")}
            className="text-red-500 font-bold cursor-pointer hover:underline"
          >
            Sign in
          </span>
        </p>
      </div>
    </div>
  );
};

export default SignupPage;
